import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

// import App from './App/';

function App(props) {
  return (
    <h1> !{props.saludo}, {props.name} </h1>
  )
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
<App />
);
